import React from 'react';

interface GymLeader {
    name: string;
    type: string;
    city_name: string;
}

interface RegionLeagueProps {
    champion: string | null;
    eliteFour: string[];
    gymLeaders: GymLeader[];
}

const RegionLeague: React.FC<RegionLeagueProps> = ({ champion, eliteFour, gymLeaders }) => {
    return (
        <div>
            {champion && (
                <div>
                    <h3>Champion</h3>
                    <p>{champion}</p>
                </div>
            )}
            {eliteFour.length > 0 && (
                <div>
                    <h3>Elite Four</h3>
                    <ul>
                        {eliteFour.map((member, index) => (
                            <li key={index}>{member}</li>
                        ))}
                    </ul>
                </div>
            )}
            {gymLeaders.length > 0 && (
                <div>
                    <h3>Gym Leaders</h3>
                    <ul>
                        {gymLeaders.map((leader, index) => (
                            <li key={index}>
                                {leader.name} - {leader.type}, {leader.city_name}
                            </li>
                        ))}
                    </ul>
                </div>
            )}
        </div>
    );
};

export default RegionLeague;
